//import { combineReducers } from 'redux'

const browsing_mode = (state = 'list', action) => {
	switch (action.type) {
		case 'TOGGLE_MODE':
			return null
		default:
			return state
  }
}

const data = (state = null, action) => {
	switch (action.type) {
		case 'DOWNLOAD_DATA':
			return action.raw_data
		default:
			return state
	}
}

export default data
/*
export default combineReducers({
  browsing_mode,
  data
})
*/
